import { Link } from "react-router-dom";

//import css
import './into.css'

export const Into = () => {
   return(
       <>
        <div className="App">
            <h1 className = 'title_into'>Henry Dogs</h1>
            <div className='div_buton_into'>
                <Link to = '/home'>
                <a className = 'buton_into'>INGRESAR</a>
                </Link>
            </div>
